// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";

import "./Token.sol";
import "./Covens.sol";
import "./Wizards.sol";
import "./Scepters.sol";
import "./RewardPool.sol";

interface IClockAuction {
    function createAuction(
        uint256 _tokenId,
        uint256 _startingPrice,
        uint256 _endingPrice,
        uint256 _duration,
        address _seller) external;
    function getAuction(uint256 _tokenId)
        external
        view
        returns
    (
        address seller,
        uint256 startingPrice,
        uint256 endingPrice,
        uint256 duration,
        uint256 startedAt
    );

    function getCurrentPrice(uint256 _tokenId)
        external
        view
    returns (uint256);
}

contract OraklerInfo { 
    BEP20 token;
    Scepters scepters;
    Covens covens;
    Wizards wizards;
    RewardPool rewardPool;

    constructor(
        BEP20 _token,
        Covens _covens,
        Wizards _wizards,
        Scepters _scepters,
        RewardPool _rewardPool
    ) {
        token = _token;
        scepters = _scepters;
        covens = _covens;
        wizards = _wizards;
        rewardPool = _rewardPool;
    }

    // Represents an auction on an NFT
    struct Auction {
        // Current owner of NFT
        address seller;
        // Price at beginning of auction
        uint128 startingPrice;
        // Price at end of auction
        uint128 endingPrice;
        // Duration (in seconds) of auction
        uint64 duration;
        // Time when auction started
        uint64 startedAt;
    }

    struct Coven {
        uint256 id;
        uint256 creationTime;
        uint256 totalResearchCapacity;
        uint256 maxScepters;
        uint256 latestPotionTime;
        Wizards.Wizard[] wizards;
        Scepters.Scepter[] scepters;
        uint256 powerCrystals;
    }

    struct CovenAuction {
        uint256 id;
        uint256 creationTime;
        uint256 totalResearchCapacity;
        uint256 maxScepters;
        uint256 latestPotionTime;
        Wizards.Wizard[] wizards;
        Scepters.Scepter[] scepters;
        uint256 powerCrystals;
        address seller;
        uint256 time;
        uint256 startingPrice;
        uint256 endingPrice;
        uint256 duration;
        uint256 price;
    }

    struct ScepterAuction {
        uint256 id;
        uint256 creationTime;
        uint256 durability;
        uint256 researchCapacity;
        address seller;
        uint256 time;
        uint256 startingPrice;
        uint256 endingPrice;
        uint256 duration;
        uint256 price;
    }

    struct WizardAuction {
        uint256 id;
        uint256 creationTime;
        uint256 scepters;
        uint256 durability;
        address seller;
        uint256 time;
        uint256 startingPrice;
        uint256 endingPrice;
        uint256 duration;
        uint256 price;
    }

    function getAllCovensOf(address owner) public view returns (Coven[] memory) {
        uint256 balance = covens.balanceOf(owner);
        Covens.Coven[] memory covenx = new Covens.Coven[](balance);
        for (uint256 i = 0; i<balance; i++) {
            covenx[i] = covens.getToken(covens.tokenOfOwnerByIndex(owner, i));
        }
        Coven[] memory res = new Coven[](covenx.length);
        for (uint256 i = 0; i<covenx.length; i++) {
            Wizards.Wizard[] memory wizardsNew = new Wizards.Wizard[](covenx[i].wizards.length);
            for (uint256 j = 0; j<covenx[i].wizards.length; j++) {
                wizardsNew[j] = wizards.getToken(covenx[i].wizards[j]);
            }
            Scepters.Scepter[] memory sceptersNew = new Scepters.Scepter[](covenx[i].scepters.length);
            for (uint256 j = 0; j<covenx[i].scepters.length; j++) {
                sceptersNew[j] = scepters.getToken(covenx[i].scepters[j]);
            }
            res[i] = Coven({
                id: covenx[i].id,
                creationTime: covenx[i].creationTime,
                totalResearchCapacity: covenx[i].totalResearchCapacity,
                maxScepters: covenx[i].maxScepters,
                scepters: sceptersNew,
                wizards: wizardsNew,
                latestPotionTime: covenx[i].latestPotionTime,
                powerCrystals: covenx[i].powerCrystals
            });
        }
        return res;
    }

    function getAllWizardsOf(address owner) public view returns (Wizards.Wizard[] memory) {
        uint256 balance = wizards.balanceOf(owner);
        Wizards.Wizard[] memory res = new Wizards.Wizard[](balance);
        for (uint256 i = 0; i<balance; i++) {
            res[i] = wizards.getToken(wizards.tokenOfOwnerByIndex(owner, i));
        }
        return res;
    }

    function getAllSceptersOf(address owner) public view returns (Scepters.Scepter[] memory) {
        uint256 balance = scepters.balanceOf(owner);
        Scepters.Scepter[] memory res = new Scepters.Scepter[](balance);
        for (uint256 i = 0; i<balance; i++) {
            res[i] = scepters.getToken(scepters.tokenOfOwnerByIndex(owner, i));
        }
        return res;
    }

    function getAllCovensOfMarket(address _market) public view returns (CovenAuction[] memory) {
        Coven[] memory covensx = getAllCovensOf(_market);
        CovenAuction[] memory res = new CovenAuction[](covensx.length);
        IClockAuction market = IClockAuction(_market);
        for (uint256 i = 0; i<covensx.length; i++) {
            (address seller,
            uint256 startingPrice,
            uint256 endingPrice,
            uint256 duration,
            uint256 startedAt) = market.getAuction(covensx[i].id);
            uint256 price = market.getCurrentPrice(covensx[i].id);
            res[i] = CovenAuction({
                id: covensx[i].id,
                creationTime: covensx[i].creationTime,
                totalResearchCapacity: covensx[i].totalResearchCapacity,
                maxScepters: covensx[i].maxScepters,
                scepters: covensx[i].scepters,
                wizards: covensx[i].wizards,
                latestPotionTime: covensx[i].latestPotionTime,
                powerCrystals: covensx[i].powerCrystals,
                seller: seller,
                price: price,
                startingPrice: startingPrice,
                endingPrice: endingPrice,
                duration: duration,
                time: startedAt
            });
        }
        return res;
    }

    function getAllSceptersOfMarket(address _market) public view returns (ScepterAuction[] memory) {
        Scepters.Scepter[] memory covensx = getAllSceptersOf(_market);
        ScepterAuction[] memory res = new ScepterAuction[](covensx.length);
        IClockAuction market = IClockAuction(_market);
        for (uint256 i = 0; i<covensx.length; i++) {
            (address seller,
            uint256 startingPrice,
            uint256 endingPrice,
            uint256 duration,
            uint256 startedAt) = market.getAuction(covensx[i].id);
            uint256 price = market.getCurrentPrice(covensx[i].id);
